import apps from "./app.js";

const getDefaultTemplateConfig = async () => {
  return {
    baseUrl: "/static",
    pageTitle: "brojs.js project",
    apps: await apps,
    navigations: {
      main: "/main",
    },
    config: {
      baseUrl: "/static",
    },
    fireappVersion: "1.0.0",
  };
};

export default getDefaultTemplateConfig;
